const periods=[
    {
        val:"THIS_MONTH",
        period:"This month"
    },
    {
        val:"LAST_MONTH",
        period:"Last month"
    },
    {
        val:"LAST_3_MONTHS",
        period:"Last 3 months"
    },
    {
        val:"LAST_6_MONTHS",
        period:"Last 6 months"
    },
    {
        val:"LAST_12_MONTHS",
        period:"Last 12 months"
    }
]

export {
    periods
}
